import React from "react";
import { Navigate } from "react-router-dom";
import { useUserAuth } from "../context/UserAuthContext";

const ProtectedRoute = ({props}) => {

    let auth = useUserAuth;
    if(!auth){
        return <Navigate to="/"/>
    }
    console.log(props);
    return props;
}

export default ProtectedRoute;
